import React, { useState } from 'react';
import apiService from '../../services/api';

const AddEvBunk = () => {
  const [formData, setFormData] = useState({
    name: '',
    address: '',
    phone: '',
    slotsAvailable: '',
    latitude: '',
    longitude: '',
    operatingHours: '',
    connectorTypes: '',
  });

  const [error, setError] = useState('');
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate form data
    if (
      !formData.name ||
      !formData.address ||
      !formData.phone ||
      !formData.slotsAvailable ||
      !formData.latitude ||
      !formData.longitude
    ) {
      setError('All required fields must be filled!');
      return;
    }

    try {
      const response = await API.post(
        '/bunks',
        formData,
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
            'Content-Type': 'application/json',
          },
        }
      );

      setMessage(response.data.message || 'EV Bunk added successfully!');
      setError('');
      setFormData({
        name: '',
        address: '',
        phone: '',
        slotsAvailable: '',
        latitude: '',
        longitude: '',
        operatingHours: '',
        connectorTypes: '',
      });
    } catch (err) {
      setMessage('');
      setError('Error adding EV Bunk: ' + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="max-w-3xl mx-auto p-8 bg-white shadow-lg rounded-lg">
      <h2 className="text-3xl font-semibold text-center text-gray-800 mb-6">Add New EV Bunk</h2>

      {message && <p className="text-green-600 mb-4 text-center">{message}</p>}
      {error && <p className="text-red-600 mb-4 text-center">{error}</p>}

      <form onSubmit={handleSubmit}>
        <div className="space-y-6">
          <InputField label="Bunk Name" name="name" value={formData.name} onChange={handleChange} required />
          <InputField label="Address" name="address" value={formData.address} onChange={handleChange} required />
          <InputField label="Phone Number" name="phone" value={formData.phone} onChange={handleChange} required />
          <InputField label="Slots Available" name="slotsAvailable" type="number" value={formData.slotsAvailable} onChange={handleChange} required />
          <InputField label="Latitude" name="latitude" type="number" value={formData.latitude} onChange={handleChange} required />
          <InputField label="Longitude" name="longitude" type="number" value={formData.longitude} onChange={handleChange} required />
          <InputField label="Operating Hours" name="operatingHours" value={formData.operatingHours} onChange={handleChange} />
          <InputField label="Connector Types (comma separated)" name="connectorTypes" value={formData.connectorTypes} onChange={handleChange} />

          <button
            type="submit"
            className="w-full py-3 px-6 bg-indigo-600 text-white font-semibold rounded-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2 mt-6 shadow-md"
          >
            Add EV Bunk
          </button>
        </div>
      </form>
    </div>
  );
};

const InputField = ({ label, name, value, onChange, type = "text", required = false }) => (
  <div>
    <label htmlFor={name} className="block text-sm font-medium text-gray-700">
      {label}
    </label>
    <input
      type={type}
      id={name}
      name={name}
      value={value}
      onChange={onChange}
      required={required}
      className="mt-1 block w-full p-4 border border-gray-300 rounded-md focus:ring-indigo-500 focus:border-indigo-500 shadow-sm"
    />
  </div>
);

export default AddEvBunk;
